                        break
                      case TouchType.Up: // 触摸抬起
                      // 触摸抬起，根据x轴总偏移量，判断是否打开删除
                        let xOffset = event.touches[0].x - this.downX
                      // 滑到目标x轴的位置
                        var toxOffset = 0
                      // 偏移量超过删除按钮一半且左滑，设置打开
                        if (Math.abs(xOffset) > vp2px(20) && xOffset < 0) {

                          this.isEdit = true
                        } else if (Math.abs(xOffset) > vp2px(20) && xOffset > 0) {
                          this.isEdit = false;
                        }
                      // 重置按下的x轴坐标
                        this.downX = 0
                        break
                    }
                  })

