                      this.today_earning=this.today_income-this.today_outcome;
                      let index=this.deleteList.indexOf(item)
                      this.deleteList.splice(index,1)
                      this.deleteList.push(item)
                      this.deleteListItem();
                      this.isEdit = false
                    }).stateEffect(true)
                  }
                }

